import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import History from "./history";

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
      <History />
  </React.StrictMode>
);
